import 'antd/dist/antd.css'
import PropTypes from 'prop-types'
import Head from 'next/head'
// app의 부모
const App = ({ Component }) => {
    return (
        <>
            <Provider store={store}>
                <Head>
                    <meta charset="utf-8" />
                    <title>Apple Farm</title>
                </Head>
                <Component />
            </Provider>
        </>
    )
}

App.propTypes = {
    Component: PropTypes.element.isRequired,
}

export default App
